import React from 'react';
import classes from './AboutUs.module.css';


const aboutUs = () =>{
    return(
        <div className={classes.AboutUs}>

            <div className={classes.Picture}>
                <h4>What is a chatbot?</h4>
            </div>
            <div className={classes.Text}>

            </div>
        </div>
    );
};

export default aboutUs;
